import React, { Component } from 'react'

class House extends Component {
  constructor () {
    super()
    this.state = { houses: [] }
  }
  componentDidMount () {
    fetch('/list')
      .then(res => res.json())
      .then()
  }

  render () {
    return <div />
  }
}

export default House
